import PropTypes from 'prop-types'


const Header = ({ title }) => {
    return (
        <div>
            <header>
                <h1 style={headingStyle}> {title} </h1>
            </header>
        </div>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

const headingStyle = {
    color: 'blue',
    backgroundColor: 'green',
    textAlign: 'center',
}

export default Header
